show_map/camera.html.body:
地图视野

地图视野操作主要包括地图的缩放、移动、旋转、倾斜、改变地图中心点等操作，以动画的方式把地图变换到指定的状态。CameraUpdateFactory提供13种方法执行地图视野操作。
可以通过 TencentMap 的 animateCamera() 方法以动画的方式把地图变换到指定的状态，也可以通过TencentMap的 moveCamera() 方法直接把地图变换到指定的状态； TencentMap 的 stopAnimation() 可以停止地图所有正在进行的动画。具体如下：
/**
 * 以动画的方式把地图变换到指定的状态
 *
 * 参数：
 * cameraupdate：状态对象
 * duration：动画执行时间（单位：ms）
 * cancelablecallback：动画状态监听器
 */
tencentMap.animateCamera(CameraUpdate cameraupdate);

tencentMap.animateCamera(CameraUpdate cameraupdate, CancelableCallback cancelablecallback);

tencentMap.animateCamera(CameraUpdate cameraupdate, long duration,CancelableCallback cancelablecallback);

// 直接把地图变换到指定的状态
tencentMap.moveCamera(CameraUpdate cameraupdate);

// 停止地图所有正在进行的动画
tencentMap.stopAnimation();

改变地图视野

由CameraPosition生成地图状态对象，直接改变地图视野。
注意：腾讯地图SDK使用的是国测局坐标系（火星坐标，GCJ-02）。
直接设置地图视野到指定状态的示例代码如下：
CameraUpdate cameraSigma =
    CameraUpdateFactory.newCameraPosition(new CameraPosition(
        new LatLng(39.977290,116.337000), // 中心点坐标，地图目标经纬度
        19,    // 目标缩放级别
        45f,   // 目标倾斜角[0.0 ~ 45.0] (垂直地图时为0)
        45f)); // 目标旋转角 0~360° (正北方为0)

tencentMap.moveCamera(cameraSigma); // 移动地图

效果如下图所示：

设置地图的锚点

设置方法为：
/**
 * 设置camera变换的中心点
 *
 * xratio 水平方向位置
 * yratio 垂直方向位置
 */
tencentMap.setCameraCenterProportion(float xratio, float yratio);

或者:
/**
 * 设置camera变换的中心点
 *
 * xratio 水平方向位置
 * yratio 垂直方向位置
 * moveMap 改变中心点的同时是否将原有中心点移到新的中心点
 */
tencentMap.setCameraCenterProportion(float xratio, float yratio, boolean moveMap);

修改地图中心点

CameraUpdateFactory中提供scrollBy()方法平移地图，newLatLng()方法改变地图中心点、移动地图，如下所示：
/**
 * 将地图向左下移动xPixel和yPexil像素
 * 
 * xPixel: 向左移动的像素
 * yPixel: 向下移动的像素
 */
tencentMap.animateCamera(CameraUpdateFactory.scrollBy(float xPixel, float yPixel));

/**
 * 把地图移动指定的经纬度到屏幕中心
 * 
 * latlng: 为目标经纬度
 */
tencentMap.animateCamera(CameraUpdateFactory.newLatLng(LatLng latlng));

/**
 * 把地图以latlng为中心，以zoom为缩放级别，移到屏幕中心
 * 
 * latlng: 目标经纬度
 * zoom: 新的指定级别，取值范围为 [3.0 ~ 19.0]
 */
tencentMap.animateCamera(CameraUpdateFactory.newLatLng(LatLng latlng, float zoom));

把地图移动到指定的经纬度范围，具体应用参见“地图标注”部分：
/**
 * 把地图移到到以指定的经纬度范围的，并且在这个范围四周加上padding像素的填充
 *
 * latLngBounds: 经纬度范围
 * padding: 四周填充的像素
 */
tencentMap.animateCamera(CameraUpdateFactory.newLatLngBounds(LatLngBounds latlngbounds, int padding));

/**
 * 把地图移动到指定经纬度范围，以适应当前屏幕的显示，并且可以为上下左右分别设置填充的像素
 *
 * latlngbounds: 经纬度范围
 * leftPadding: 左侧填充像素
 * rightPadding: 右侧填充像素
 * topPadding: 右侧填充像素
 * bottomPadding: 顶部填充像素、底部填充像素
 */
tencentMap.animateCamera(CameraUpdateFactory.newLatLngBoundsRect(LatLngBounds latlngbounds, int leftPadding, int rightPadding, int topPadding, int bottomPadding));

/**
 * 把地图移动到指定元素所在范围，以适应当前屏幕的显示，并且可以为上下左右分别设置填充的像素.
 *
 * latLngBounds: 经纬度范围（指定西南和东北的坐标点）
 * padding: 四周填充的像素
 * leftPadding: 左侧填充像素
 * rightPadding: 右侧填充像素
 * topPadding: 顶部填充像素
 * bottomPadding: 底部填充像素
 * elements: 要显示在底图上的元素
 */
tencentMap.animateCamera(CameraUpdateFactory.newElementBoundsRect(List elements, int leftPadding, int rightPadding, int topPadding, int bottomPadding));

修改地图缩放级别

CameraUpdateFactory中提供zoomIn()、zoomOut()、zoomTo()、zoomBy()等方法可以改变地图的缩放级别。
设置方法为：
// 把地图放大一级
tencentMap.animateCamera(CameraUpdateFactory.zoomIn()); 

// 把地图缩小一级
tencentMap.animateCamera(CameraUpdateFactory.zoomOut()); 

// 把地图缩放到目标级别zoomLevel，取值范围为 [4.0 ~ 20.0]
tencentMap.animateCamera(CameraUpdateFactory.zoomTo(float zoomLevel));

// 在当前的缩放级别下，把缩放级别变化zoomLevelDelta，如果超出了范围，则停止在范围内
tencentMap.animateCamera(CameraUpdateFactory.zoomBy(float zoomLevelDelta)); 

/**
 * 在当前的缩放级别下，把缩放级别变化zoomLevelDelta，如果超出了范围，则停止在范围内；
 *
 * zoomLevelDelta: 要变化的级别数值
 * point: 当前地图所处的地图点，移动后屏幕处于中心点
 */
tencentMap.animateCamera(CameraUpdateFactory.zoomBy(float zoomLevelDelta, Point point));

限制地图的缩放级别范围

// 设置地图的最大缩放级别  （3~19）
tencentMap.setMaxZoomLevel(int zoomLevel); 

// 设置地图的最小缩放级别
tencentMap.setMinZoomLevel(int zoomLevel);

旋转、倾斜地图

设置方法为：
// 将地图顺时针旋转rotate度，并且向后倾斜skew度
tencentMap.animateCamera(CameraUpdateFactory.rotateTo(float rotate, float skew));

地图视野变化监听

// 设置地图视野变化的监听接口
tencentMap.setOnCameraChangeListener(new TencentMap.OnCameraChangeListener() {
        @Override public void onCameraChange(CameraPosition cameraPosition) {

        }

        @Override public void onCameraChangeFinished(CameraPosition cameraPosition) {

        }
    }
);

show_map/uisetting.html.body:
地图 UI 设置

腾讯地图提供了UiSettings类以方便开发者对地图手势及SDK提供的控件的控制，以定制自己想要的视图效果。UiSettings类的实例化也是通过TencentMap来获取：
// 获取地图界面操作对象
UiSettings mUiSettings = tencentMap.getUiSettings();

控件设置

缩放按钮
可以控制地图的缩放级别，每次点击改变1个级别，开启后此控件显示在右下角，设置方式及效果图如下所示：
// 设置是否显示缩放按钮，true表示显示，false表示不显示
mUiSettings.setZoomControlsEnabled(boolean flag); 
// 获取当前是否显示缩放控件
mUiSettings.isZoomControlsEnabled();


指南针
可以指示地图的南北方向，默认的视图状态下不显示，只有在地图的偏航角或俯仰角不为0时才会显示，并且该控件的默认点击事件会将地图视图的俯仰角和偏航角动画到0的位置。此控件显示在左上角，设置方式及效果图如下所示：
// 设置是否显示罗盘
mUiSettings.setCompassEnabled(boolean flag);
// 获取当前是否开启罗盘控件
mUiSettings.isCompassEnabled();
// 设置是否显示罗盘
mUiSettings.setCompassEnabled(true);
// 地图罗盘点击事件
tencentMap.setOnCompassClickedListener(new TencentMap.OnCompassClickedListener() {
    @Override
    public void onCompassClicked() {

    }
}
);


罗盘的填边设置请参考“接口文档”。
定位控件
当通过 TencentMap.setLocationSource(locationSource) 设置好地图的定位源后，点击此按钮可以在地图上标注一个蓝点指示用户的当前位置。定位控件显示在右下角，设置方式和效果图如下所示：
// 设置是否显示定位按钮
mUiSettings.setMyLocationButtonEnabled(boolean flag); 
// 获取当前是否显示定位控件
mUiSettings.isMyLocationButtonEnabled();


比例尺控件
默认显示在左下角，也可以通过参数进行设置，设置方式和效果图如下所示：
// 设置当前是否显示比例尺
mUiSettings.setScaleViewEnabled(true);
// 获取当前是否显示比例尺
mUiSettings.isScaleViewEnabled();
// 设置比例尺的显示位置
/**
    * 设置比例尺的显示位置
    *
    *  @param position 地图比例尺显示位置：
    *   {@link TencentMapOptions#SCALEVIEW_POSITION_BOTTOM_CENTER}
    *   {@link TencentMapOptions#SCALEVIEW_POSITION_BOTTOM_LEFT}
    *   {@link TencentMapOptions#SCALEVIEW_POSITION_BOTTOM_RIGHT}
    *   {@link TencentMapOptions#SCALEVIEW_POSITION_TOP_CENTER}
    *   {@link TencentMapOptions#SCALEVIEW_POSITION_TOP_LEFT}
    *   {@link TencentMapOptions#SCALEVIEW_POSITION_TOP_RIGHT}
    */
UiSettings.setScaleViewPosition(int position);


地图Logo
腾讯地图logo默认显示在右下角，改变Logo位置的示例代码如下：
/**
* 设置Logo的显示位置
*  @param logoAnchor 地图logo显示位置：
*    {@link TencentMapOptions#LOGO_POSITION_BOTTOM_CENTER}
*    {@link TencentMapOptions#LOGO_POSITION_BOTTOM_LEFT}
*    {@link TencentMapOptions#LOGO_POSITION_BOTTOM_RIGHT}
*    {@link TencentMapOptions#LOGO_POSITION_TOP_CENTER}
*    {@link TencentMapOptions#LOGO_POSITION_TOP_LEFT}
*    {@link TencentMapOptions#LOGO_POSITION_TOP_RIGHT}
*/
UiSettings.setLogoPosition(int logoAnchor);


注意：使用腾讯地图SDK要求显示logo，如上图所示。如有特殊需求可通过 setLogoPositionWithMargin() 方法设置偏移，示例代码如下：
/**
 * 设置Logo的显示位置，带偏移量，单位像素
 *
 * position: 地图logo显示位置，选项同上
 * top:      position为TOP时，该值生效，不需要偏移请传0或负数
 * bottom:   position为BOTTOM时，该值生效，不需要偏移请传0或负数
 * left:     position为LEFT时，该值生效，不需要偏移请传0或负数
 * right:    position为RIGHT时，该值生效，不需要偏移请传0或负数
 * 
 */
UiSettings.setLogoPositionWithMargin(int position, int top, int bottom, int left, int right);

或：
/**
* 根据地图四个Anchor 模式（左上、左下、右下、右上）以及相应的Margins来设置Logo位置
*
* @param logoAnchor
*    {@link TencentMapOptions#LOGO_POSITION_BOTTOM_LEFT}
*    {@link TencentMapOptions#LOGO_POSITION_BOTTOM_RIGHT}
*    {@link TencentMapOptions#LOGO_POSITION_TOP_LEFT}
*    {@link TencentMapOptions#LOGO_POSITION_TOP_RIGHT}
* @param marginParams
*    若logoAnchor为 LOGO_POSITION_BOTTOM_LEFT,则Logo的 bottomMargin 为 marginParams[0], leftMargin 为 ma  rginParams[1]
*    若logoAnchor为 LOGO_POSITION_BOTTOM_RIGHT,则Logo的 bottomMargin 为 marginParams[0], rightMargin 为 ma  rginParams[1]
*    若logoAnchor为 LOGO_POSITION_TOP_RIGHT,则Logo的 topMargin 为 marginParams[0], rightMargin 为 marginParams[1]
*    若logoAnchor为 LOGO_POSITION_TOP_LEFT ，则Logo 的 topMargin 为 marginParams[0], leftMargin 为 marginParams[1]
*/
UiSettings.setLogoPosition(int logoAnchor , int[] marginParams);

手势设置与监听

拖动手势
可以用手指拖动地图四处滚动（平移）或用手指滑动地图（动画效果），也可以禁用或开启平移（滑动）手势。
// 设置是否开启地图滚动手势
mUiSettings.setScrollGesturesEnabled(boolean flag);
// 获取当前是否支持滚动手势
mUiSettings.isScrollGesturesEnabled();

缩放手势
缩放手势可改变地图的缩放级别：双击地图可以使缩放级别增加1 (放大)；两个手指捏/拉伸也可以控制缩放级别。
禁用缩放手势不会影响用户使用地图上的缩放控制按钮。
// 设置是否开启地图缩放手势
mUiSettings.setZoomGesturesEnabled(boolean flag);
// 获取当前是否支持缩放手势
mUiSettings.isZoomGesturesEnabled();

倾斜手势
通过两个手指的移动，控制地图的倾斜角。
// 设置是否开启地图倾斜手势
mUiSettings.setTiltGesturesEnabled(boolean flag);
// 获取当前是否支持倾斜手势
mUiSettings.isTiltGesturesEnabled();

旋转手势
通过两个手指控制，旋转3D地图。
// 设置是否开启地图旋转手势
mUiSettings.setRotateGesturesEnabled(boolean flag);
// 获取当前是否支持旋转手势
mUiSettings.isRotateGesturesEnabled();

所有手势
包括滚动手势、缩放手势、倾斜手势、旋转手势，可同时设置手势的开启或禁止。
// 设置是否开启地图所有手势
mUiSettings.setAllGesturesEnabled(boolean flag);

手势监听
手势监听器的事件会通知到所有监听器。
//设置腾讯地图手势监听接口
tencentMap.setTencentMapGestureListener(new TencentMapGestureListener() {
        //单指双击
        @Override
        public boolean onDoubleTap(float v, float v1) {
            return false;
        }

        //单指单击
        @Override
        public boolean onSingleTap(float v, float v1) {
            return false;
        }

        //单指惯性滑动
        @Override
        public boolean onFling(float v, float v1) {
            return false;
        }

        //单指滑动
        @Override
        public boolean onScroll(float v, float v1) {
            return false;
        }

        //长按
        @Override
        public boolean onLongPress(float v, float v1) {
            return false;
        }

        //单指按下
        @Override
        public boolean onDown(float v, float v1) {
            return false;
        }

        //单指抬起
        @Override
        public boolean onUp(float v, float v1) {
            return false;
        }

        //地图稳定下来
        @Override
        public void onMapStable() {

        }
    }
);

//添加一个腾讯地图手势监听接口
tencenMap.addTencentMapGestureListener(TencentMapGestureListener listner); 

//移除一个腾讯地图手势监听接口
tencenMap.removeTencentMapGestureListener(TencentMapGestureListener listner);

overlays/marker.html.body:
点标注
点标注可用来标注地图上的位置，如用户位置、店铺位置。地图SDK提供的点标注功能包括两部分：标注点位置的 Marker 和显示位置信息的 InfoWindow ，同时提供了 Marker 的点击、拖拽事件监听和 InfoWindow 的点击监听。
添加 Marker 及 InfoWindow

添加Marker可以在地图上标注指定的点，MarkerOption是设置Marker参数的类。添加Marker的代码如下：
LatLng latlng_disanji = new LatLng(39.984253,116.307439);
final Marker marker = tencentMap.addMarker(new MarkerOptions()
            // 标注的位置
            .position(latlng_disanji)
            // 标注的InfoWindow的标题
            .title("第三极大厦")
            //标注的InfoWindow的内容
            .snippet("地址: 北京市北四环西路66号")
            // 标注的锚点，取值为[0.0 ~ 1.0]
            .anchor(0.5f, 0.5f)
    );

// 显示信息窗，也可以通过点击Marker图标设置显示或隐藏
marker.showInfoWindow();

// 把地图移动到指定经纬度
tencentMap.moveCamera(CameraUpdateFactory.newLatLng(latlng_disanji));

以上代码绘制的 Marker 及 InfoWindow 效果图如下：

Marker 常用属性如下：



属性
说明




position
标注的位置


title
标注的InfoWindow的标题，如果设置了InfoWindowAdapter则失效


snippet
标注的InfoWindow的内容


icon
设置标注的样式


anchor
标注的锚点


draggable
标注是否可以被拖动


visible
标注是否可见


rotation
标注的旋转角度


alpha
标注的透明度


zIndex
标注的层级关系


indoorInfo
为Marker添加室内图信息（buildingId，floorName), 当添加室内图信息后，Marker将会随着绑定的室内图状态改变而展示和隐藏


infoWindowEnable
标注是否可以弹出InfoWindow


flat
是不是3D标注，3D标注会随着地图倾斜面倾斜


displayLevel
显示级别：0 不参与避让，1-65535 参与避让且1的级别最高


autoOverturnInfoWindow
